import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';
import Sidebar from './Sidebar';  // Add Sidebar import
import Login from './Login';
import HomePage from './HomePage';
import Users from './Users';
import CreateUsers from './CreateUsers';
import Vehicles from './Vehicles';
import CreateVehicles from './CreateVehicles';
import Drivers from './Drivers';
import CreateDrivers from './CreateDrivers';
import Order from './Order';
import OrderByDriver from './OrderByDriver';
import OrderForPickup from './OrderForPickup';
import OrderForUser from './OrderForUser';
import CreateOrders from './CreateOrders';
import Dispatch from './Dispatch';

function App() {
  return (
    <Router>
      <div className="flex min-h-screen">
        {/* Sidebar */}
        <Sidebar />

        {/* Main Content Area */}
        <div className="flex-1">
          <Header />
          <div className="p-4"></div>

          {/* Main Routes */}
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/home" element={<HomePage />} />
            <Route path="/users" element={<Users />} />
            <Route path="/newuser" element={<CreateUsers />} />
            <Route path="/vehicles" element={<Vehicles />} />
            <Route path="/newvehicle" element={<CreateVehicles />} />
            <Route path="/drivers" element={<Drivers />} />
            <Route path="/newdrivers" element={<CreateDrivers />} />
            <Route path="/order" element={<Order />} />
            <Route path="/orderbydriver" element={<OrderByDriver />} />
            <Route path="/orderforpickup" element={<OrderForPickup />} />
            <Route path="/orderforuser" element={<OrderForUser />} />
            <Route path="/neworder" element={<CreateOrders />} />
            <Route path="/dispatch" element={<Dispatch />} />
          </Routes>

          {/* Footer */}
          <Footer />
        </div>
      </div>
    </Router>
  );
}

export default App;
